import React from "react";
import "./style.css";

function ImageCard(props) {
  return (
    <div className="card">
      <div className="img-container">
        <img onClick={() => props.handleClick(props.id)} src={props.image} />
      </div>
    </div>
  );
}

export default ImageCard;
